import React from "react";
import styled from "styled-components";

const TopContainer = styled.div`
    width: 100%;
    height: 100vh;
    padding: 0;
`;

const BackgroundTop = styled.div`
    width: 100%;
    height: 100%;
    display: flex;
    flex-diection: column;
    align-items: center;
`;

export function TopSection(props) {

    return <TopContainer>
        <BackgroundTop></BackgroundTop>
    </TopContainer>

}
